(27, 'Lenovo - IdeaPad G40-45', 'Lenovo', 'Lenovo - IdeaPad G40-45 hadir dengan  baterai yang tahan lama, dan kecepatan yang unggul', 10, 8500000, 0, 1, 'LE629ELAA2VUL9ANID-5372512\r\n;SONIC MASTER;3-4 Jam;AMD Quad Core A8 6410M;3.20;15.6;AMD R5 2 GB;500;Lenovo - IdeaPad G40-45;DOS;24 X 2 X 34;8 GB;Yes;yes', '1 Tahun', 'hitam', 'images/lenovo1.PNG', 3, 12, 1),
(28, 'Acer Z1402-C1RU', 'Acer', 'Acer kembali mempersembahkan, laptop dengan spesifikasi yang tidak kalah handal dari pendahulunya. Seri Acer Z1402-C1RU hadir dengan desain yang kompak dan dikemas dengan layar berukuran 14". Dilengkapi OS Windows 10 terbaru serta prosesor Intel Celeron 2957U, laptop yang satu ini siap menjadi andalan komputasi Anda baik di sekolah maupun kantor.\r\n', 10, 3470000, 0, 1, 'AC016ELAA1SAIGANID-3277440;SONIC MASTER;3-4 Jam;Intel Celeron 2957U;3.20;15.6;AMD R5 2 GB;500;Acer Z1402-C1RU;Windows 10;34.2 x 24 x 2.9;8 GB;Yes;yes', '1 Tahun', 'hitam', 'images/lp9.PNG', 2, 12, 1),
(29, 'Acer One 10', 'Acer', 'Acer menghadirkan seri netbook dengan kinerja optimal namun dengan harga yang terjangkau, Acer One 10- 2GB RAM - Quad Core Z3735F - 10.1". Hadir dengan desain yang portabel dan juga ringan, Anda pun tidak akan mudah lelah selama membawanya bepergian. Acer One 10 merupakan pilihan yang cocok dipakai berselancar di web, e-mail, chat, mendengarkan musik dan pekerjaan komputasi lainnya secara instan.\r\n', 10, 3470000, 0, 1, 'AC016ELAA1SAIFANID-3277439;SONIC MASTER;3-4 Jam; Intel Quad Core Z3735F;3.20;15.6;AMD R5 2 GB;500;Acer Z1402-C1RU;Windows 8.1;34.2 x 24 x 2.9;8 GB;Yes;yes', '1 Tahun', 'Silver', 'images/lp10.PNG', 2, 12, 1),
(30, 'Lenovo PC All In One C20-05', 'Lenovo', 'Di desain untuk bekerja sempurna dengan Microsoft Windows 8.1, Lenovo C20 dibekali prosesor AMD berperforma tinggi. Fitur Energy Management nya mampu memperpanjang daya baterai C20 melalui penggunaan teknologi hemat energi terkini.\r\n', 18, 4899000, 0, 2, 'LE629ELAUI5AANID-817790;AMD;1.50;19.5;2;500;2.0;IdeaCenter All In One C20;DOS;60 x 60 x 50 Cm;2 GB', '1 Tahun', 'hitam', 'images/Capture.PNG', 4, 12, 1),
(31, 'HP 251-014L Desktop PC', 'HP', 'Dengan pilihan upgrade yang mudah, HP Pavilion 251 adalah desktop PC serbaguna yang dapat memberikan banyak manfaat untuk kegiatan Anda sehari-hari. Dengan desain modern membuat desktop ini cocok ditempatkan di mana pun, membuat suasana ruangan Anda terasa lebih mengesankan. Dengan performa dan grafis yang handal serta kapasitas storage yang cukup sebagai tempat penyimpanan, kini Anda telah menemukan desktop PC yang ideal untuk kegiatan komputasi, hiburan dan gaming Anda.\r\n', 18, 6200000, 0, 2, 'HP467ELBCZN8ANID-1272562;Intel Core i3-4170;3.70;15.6;2;500;2.0;251-014L;DOS;38.98 x 36.77 x 17.55 Cm;2 GB', '1 Tahun', 'hitam', 'images/pc2.PNG', 18, 12, 1),
(32, 'HP PC 22-3015L All In One', 'HP', 'HP Pavilion 22 All-in-One Desktop, membuat hidup Anda lebih sederhana yang dapat memanjakan Anda setiap kali menggunakannya. All-in-One desktop ini diDesain sepraktis mungkin, dengan Processor Intel®Core™i3 berkecepatan 3.2GHz, didukung dengan 2GB RAM DDR3 dan Kapasitas Penyimpanan yang besar 500GB HDD serta Tampilan Layar yang lebar 22" Tochscreen enable IPS yang dapat memudahkan Anda dalam menjalankan aktivitas maupun pekerjaan kantor. Menyimpan semua file penting Anda, musik, foto, video, dan lainnya tanpa kompromi berkat kapasitas penyimpanan yang luas. Dengan HP TrueVision HD webcam yang terbaik. Bahkan dalam cahaya rendah sekalipun. \r\n', 14, 7750000, 0, 2, 'HP467ELBIJJUANID-1576841;Intel Core i3;3.20;22.0;2;500;2.0;PC 22-3015L All In One;Linux;57.1 x 43.5 x 9.9 cm;2 GB', '1 Tahun', 'hitam', 'images/pc3.PNG', 15, 12, 1),
(33, 'Apple iMac 8GB 27" MF886 Retina 5K Display', 'Apple', 'Apple menghadirkan iMac 27" with Retina 5K Display, iMac terbaru ini mendukung resolusi luar biasa \r\nbesar yaitu 5K (5120 x 2880) dengan total 14.7 juta pixels ! Teknologi layar yang digunakan \r\npada iMac Retina adalah bahan Oxide TFT (Thin Film Transistor) \r\nuntuk mentransfer energi pada setiap piksel di layarnya\r\n', 30, 36999999, 0, 2, 'AP082ELASY7WANID-724044;Intel;3.50;27.0;2;1000;2.0;iMac 27 inch MF886 Retina 5K Display;Yosemite;65 x 51.6 x 20.3 cm;8 GB', '1 Tahun', 'Silver', 'images/mac1.PNG', 18, 12, 1),
(34, 'HP Pc AIO 20-r025d', 'HP', 'Bawalah dunia layar kecil Anda ke layar lebar. Ajak semua orang dirumah Anda menikmati konten Google Play favorit mereka di layar besar 19.45 inch. \r\nMulai sekarang setiap ruangan bisa dijadikan tempat hiburan bagi Anda dengan\r\nmenggunakan PC All In One\r\n', 30, 9399000, 0, 2, 'HP467ELAA30OLPANID-5665961;Intel® Core™ i5-4460T;2.70;20.0;2;1000;2.0;Pc AIO 20-r025d;Windows 8.1;50.02 x 35.92 x 6.5 cm;4 GB', '1 Tahun', 'Silver', 'images/hppc1.PNG', 30, 12, 1),
(35, 'HP PC All In One 20-R023L', 'HP', 'Komputer HP dengan layar seluas 20 inci ini mampu menawarkan tampilan yang sangat baik pada resolusi 1600 x 900 pixel, tampilan objeknya pun terlihat cukup tajam serta dengan warna yang akurat. Dan pada bagian atas monitor pun telah di sediakan webcam lengkap dengan microphone nya yang dapat anda manfaatkan untuk melakukan panggilan video. Dan dari segi penggunaan, k\r\nomputer HP Pavilion 20 - r023l ini membutuhkan daya yang tergolong rendah yaitu hanya 90 watt.\r\n', 15, 8000000, 0, 2, 'HP467ELAA2Y9Y2ANID-5527670;Intel Core i5-4460T;2.70;20.0;2;1000;2.0;Hp 20-r023L;DOS;7.65 x 49.6 x 34.0 cm;4 GB', '1 Tahun', 'Hitam', 'images/hppc.PNG', 15, 12, 1),
(36, 'HP Pavilion All In One 20-R022L', 'HP', 'HP 20-R022L hadir untuk memenuhi kebutuhan personal komputer yang akan membantu Anda dalam kegiatan komputasi sehari-hari baik di rumah maupun di kantor. Dikemas dengan sangat praktis. Cocok untuk diletakkan di setiap ruangan Anda dan mudah untuk dipindahkan.Dibekali prosesor Intel® Core™ i3-4170T, 3.2GHz dengan memori RAM 2 GB DDR3 serta dibekali layar lebar 19.5" , memberikan Anda kemudahan dalam melakukan pekerjaan komputasi sehari-hari. \r\nUntuk media penyimpanan data tersedia 500GB HDD yang cukup menyimpan berbagai data penting Anda.\r\n', 15, 7235600, 0, 2, 'HP467ELAA2ONR1ANID-4948791;Intel Core i3;3.20;19.5;2;500;2.0;All In One 20-R022L (I3-4170);DOS;7.2x49.5x33.9 cm;2 GB', '1 Tahun', 'Putih', 'images/hppc7.PNG', 8, 12, 1),
(37, 'Lenovo C360 - 57 321560', 'Lenovo', 'Lenovo C360 menggunakan proc core Intel Dual Core G2030 dan memiliki kapasitas memory 2GB DDR3. Lenovo C360 juga memiliki design yang sangat tipis dan elegant. Lenovo C360 dilengkapi dengan graphic intel shared yang memungkinkan kita dalam bermain grafis maupun game yang berat.\r\nLenovo C360 sudah dilengkapi hardisk 500GB untuk menampung banyak data didalamnya. Lenovo C360 juga sudah dilengkapi dengan DVD RW,LAN,Wifi,6 in 1 card reader.\r\n', 15, 7850000, 0, 2, 'LE629ELBORACANID-1920329;Intel Dual Core G2030;2.60;19.5;2;500;2.0;Lenovo C360 - 57 321560;Windows 8;48.5 x 5 x 39.8 cm;2 GB', '1 Tahun', 'Hitam', 'images/pc8.PNG', 6, 12, 1),
(38, 'Lenovo C560-8320', 'Lenovo', 'Jika anda mencari desktop premium, maka bisa jadi Lenovo IdeaCentre C560-8320 lah jawabannya. Sebuah perangkat komputer desktop dengan layar yang lebar dan jernih 23 inch LED didukung dengan NVIDIA GeForce 800M dengan 2 GB video memory, salah satu kartu grafis tercanggih di kelasnya yang membuat tampilan warna semakin tajam dan detail. Anda akan merasakan sebuah pengalaman memiliki komputer desktop ini yang bisa diandalkan untuk keperluan multimedia ataupun memainkan games-games yang membutuhkan daya besar.\r\n', 15, 14450000, 0, 2, 'LE629ELBP404ANID-1940977;INTEL Core i7-4785T;2.20;23.0;2;500;2.0;Lenovo C560-8320;Windows 8.1;22.2 x 2.09 x 17.48 cm;4 GB', '1 Tahun', 'Hitam', 'images/pc9.PNG', 11, 12, 1),
(39, 'Lenovo B5030-CMID', 'Lenovo', 'Lenovo IdeaCentre B50-30-DID mengusung desain all in one PC dimana CPU dan layar sudah menjadi satu sehingga berdampak pada ukurannya yang semakin minimalis. Dengan desin yang terbilang cukup ramping tersebut tentu akan semakin memudahkan anda dalam meletakkandimeja kerja anda tanpa perlu memakan banyak ruang di dalamnya. Dalam hal performa, prosesor yangdigunakannya juga terbilang cukup handal yakni Intel Core i5-4460 dengan cache 6M yang mampu berlari hingga kecepatan 2,7 GHz. \r\n', 15, 14000000, 0, 2, 'LE629ELAA1Y5SBANID-3609557;INTEL Core i7-4790;2.20;23.0;2;500;2.0;Lenovo B5030;Windows 8.1;32x10x25 cm;4 GB', '1 Tahun', 'Hitam', 'images/pc10.PNG', 18, 12, 1),
(40, 'HiMedia Mini Wireless Keyboard UKB-500', 'HiMedia', 'Mini Wireless Keyboard 92 keys, cocok untuk media player. Produk ini diproduksi dengan cermat untuk menghasilkan produk yang bermutu. Terbuat dari bahan dengan kualitas terbaik. Belilah sekarang juga. Stock terbatas, jangan sampai kehabisan.', 18, 160000, 0, 5, 'HI729ELAXU58ANID-997177;Wireless;UKB-500;17 x 12 x 3', '1 bulan', 'hitam', 'images/keyboard1.PNG', 0, 12, 1),
(41, 'Mini Wireless Remote Bluetooth Keyboard', 'OEM', 'Brand new and high quality.Compatible with Windows, Android and IOS device. The touchpad function will not work in IOS devices(Such as Iphone iPad)', 18, 331632, 0, 5, 'OE427ELBB81MANID-1174684;Wireless;UKB-500;17 x 7 x 7', 'no waranty', 'hitam', 'images/keyboard2.PNG', 0, 12, 1),
(42, 'Rexus Keyboard Gaming K7M - Hitam', 'Rexus', 'Brand new and high quality.Compatible with Windows, Android and IOS device. The touchpad function will not work in IOS devices(Such as Iphone iPad)', 18, 215000, 0, 5, 'RE257ELAIIDSANID-428859;Wireless;Keyboard Gaming;49 x 4 x 22.5', '1 bulan', 'hitam', 'images/keyboard3.PNG', 2, 12, 1),
(43, 'Razer Keyboard Blackwidow Ultimate Chroma - Hitam', 'Rexus', 'Razer Keybord Blackwidow Chroma dirancang khusus untuk para gamer,dengan fitur mekanikal baru yang memberikan kecepatan dan respons yang belum pernah anda rasakan sebelumnya.', 18, 2630000, 0, 5, 'RA824ELAJ2CAANID-461667;Wireless;Keyboard Gaming;42 x 20 x 6', '1 tahun', 'hitam', 'images/keyboard4.PNG', 3, 12, 1),
(44, 'Razer Keyboard Deathstalker Ultimate T1 - Hitam', 'Rexus', 'Razer Keybord Blackwidow Chroma dirancang khusus untuk para gamer,dengan fitur mekanikal baru yang memberikan kecepatan dan respons yang belum pernah anda rasakan sebelumnya.', 18, 3730000, 0, 5, 'RA824ELAHX28ANID-394413;Wireless;Deathstalker Ultimate T1;57 x 27 x 7', '1 tahun', 'hitam', 'images/keyboard5.PNG', 3, 12, 1),
(45, 'Logitech MK 220 Logitech Wireless Combo Keyboard & Mouse - Hitam', 'Logitech', 'Logitech MK 220 Wireless Combo Keyboard & Mouse - Hitam kenyamanan Anda untuk mengetik dimana saja dengan jarak wireless 10 meter. Dengan desain yang padat, sehingga terlihat kokoh menjadikannya cocok dengan PC Anda.', 18, 233500, 0, 5, 'LO651ELADT1XANID-208180;Wireless;Deathstalker Ultimate T1;46 x 12 x 5', '1 tahun', 'hitam', 'images/keyboard6.PNG', 3, 12, 1),
(46, 'Mediatech-Wireless Keyboard HK 3800+Wireless Mouse-Hitam', 'Mediatech', 'Keyboard ini memiliki bentuk yang melengkung di bagian bawahnya sehingga keyboard ini akan terlihat lebih unik. Selain keyboard terdapat juga wireless mouse yang resolusinya mencapai 1600dpi dan dapat mencapai jarak 10 m baik keyboard serta mouse. Keyboard ini memiliki warna di beberapa tombolnya.', 18, 202650, 0, 5, 'ME455ELADIVDANID-192517;Wireless;Keyboard Wireless;43 x 1 x 13', '1 tahun', 'hitam', 'images/keyboard7.PNG', 3, 12, 1),
(47, 'Professional 6D 3200DPI LED Optical Wired Gaming Mouse for Pro Gamer Excellent\r\n', 'OEM', 'Product details of Professional 6D 3200DPI LED Optical Wired Gaming Mouse for Pro Gamer Excellent,100% brand new and high quality. 6 buttons with scroll wheel.\r\nEach file to switch between different colors of LED lights cool tips.\r\n', 18, 133000, 0, 3, 'OE427ELAA2HVGKANID-4586133;Wireless;Pemasangan mandiri;Mouse Kabel;Baterai;15 x 7 x 7 cm;Kabel', 'No Warranty', 'hitam', 'images/mouse1.PNG', 0, 12, 1),
(48, 'Rexus Mouse Gaming Wireless Avenger RX-110A - Hitam\r\n', 'Rexus', 'MOUSE WIRELESS Rexus Rx-110 Avenger merupakan pilihan tepat untuk bermain games dan juga pemakaian sehari hari.\r\nMeskipun memiliki spesifikasi untuk para Gamers, mouse ini juga sangat cocok untuk digunakan sehari-hari dirumah, kampus maupun kantor.\r\n', 18, 98542, 0, 3, 'RE257ELBHTJAANID-1538070;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;15x10x15 cm;Wireless', 'No Warranty', 'hitam', 'images/mouse2.PNG', 1, 12, 1),
(49, '7 Button LED Wired Gaming Mouse Black\r\n', 'Rexus', 'Ergonomically designed, long-term use without fatigue. Intelligent connectivity, no need to code, plug & play\r\nBuilt-weight iron, feel comfortable, mobile and stability \r\n', 18, 108000, 0, 3, 'OE427ELBGJ1LANID-1465171;Wireless;Pemasangan mandiri;Mouse Kabel;Baterai;10 x 10 x 10 cm;Kabel', 'No Warranty', 'hitam', 'images/mouse3.PNG', 1, 12, 1),
(50, '6 Button Wireless Gaming Red Mice 2.4Ghz Adjustable Portable Mouse for PC Laptop\r\n', 'Fan Tech', 'Ergonomically designed,comfort grip. Portable and weight light, very convenient to carry and store.\r\nLeft key ,Right key ,Middle key ,Forward key,Back key ,DIP Key.', 18, 74000, 0, 3, 'NO210ELAA2SB38ANID-5164550;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;15 x 14 x 10 cm;Wireless', 'No Warranty', 'merah', 'images/mouse4.PNG', 1, 12, 1),
(51, 'Moonar USB & Wireless Mouse Car\r\n', 'Moonar', '100% brand new and high quality. USB 2.4G wireless mouse car shape, comfortable touch. Free moving in 10 meters\r\nOptical sensor up to 1600 DPI', 18, 81000, 0, 3, 'MO202ELAXI6JANID-979513;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;6 x 3 x 3 cm\r\n;Wireless', 'No Warranty', 'merah;hitam;biru', 'images/mouse5_1.PNG;images/mouse5_2.PNG;images/mouse5_3.PNG', 1, 12, 1),
(52, 'Moonar USB Wireless Optical Mouse - Pink\r\n', 'Moonar', 'Slim, ergonomically-designed 2.4 GHz wireless mouse, ideal for home or office use,Compatible with most laptop and desktop computers via USB receiver (packed in the mouse)\r\nOptical tracking technology, works on many different surfaces', 18, 64000, 0, 3, 'MO202ELAXH5HANID-977701;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;6 x 3 x 3 cm\r\n;Wireless', 'No Warranty', 'pink', 'images/mouse6.PNG', 1, 12, 1),
(53, '2.4G Wireless Foldable Folding Arc Optical Mouse\r\n', 'OEM', 'This Wireless Mouse is a good choice for you: up to 10m Wireless Operation Distance, Ergonomic Design, High Accuracy, High Quality, Modern Design.\r\nIdeal for office and home use.', 18, 86000, 0, 3, 'OE427ELBKAPPANID-1674435;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;6 x 3 x 3 cm\r\n;Wireless', 'No Warranty', 'hitam;abu-abu;putih', 'images/mouse7_1.PNG;images/mouse7_2.PNG;images/mouse7_3.PNG', 1, 12, 1),
(54, 'Colorful Backlight 4000DPI Optical Wired Gaming Mouse\r\n', 'OEM', 'Ultra-precise Scroll Wheel. Optical technology works on most surfaces. \r\nErgonomically designed, long-term use without fatigue.Intelligent connectivity, no need to code, plug & play.', 18, 87000, 0, 3, 'OE427ELBGJ5RANID-1465321;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;15 x 10 x 10\r\n;Wireless', 'No Warranty', 'hitam', 'images/mouse8.PNG', 1, 12, 1),
(55, 'Logitech M280 Mouse Wireless\r\n', 'Logitech', 'Anda akan mendapatkan kehandalan dan kenyaman dengan mouse nirkabel dengan transmisi data yang cepat dan tanpa hambatan.Mouse ini dilengkapi dengan switch on/off, mode penonaktifan mouse (smart sleep) \r\ndan indikator kondisi isi baterai yang dapat memperpanjang daya tahan baterai.\r\n', 18, 175000, 0, 3, 'LO651ELBN9G4ANID-1834453;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;12 x 5 x 3 cm\r\n;Wireless', '1 tahun', 'hitam;biru;merah', 'images/mouse9_1.PNG;images/mouse9_2.PNG;images/mouse9_3.PNG', 1, 13, 1),
(56, 'Logitech Mouse Wireless M238', 'Logitech', 'Sambutlah kegembiraan, kecerdasan, keberanian, dan kepribadian dengan Logitech M238 Wireless Mouse. mouse paling bahagia yang pernah Anda temukan. Hadir dengan desain yang lucu dan menggemaskan, mouse wireless persembahan dari Logitech ini sangat cocok untuk menemani Anda bekerja setiap harinya. Selain memiliki fitur yang canggih, mouse ini juga mampu mempercantik area kerja Anda berkat desain dan presisinya yang sangat baik. Dengan navigasi presisi dan kualitas Logitech,\r\nAnda tidak perlu khawatir dengan kualitas dari Logitech M238 Wireless Mouse ini.\r\n', 18, 185000, 0, 3, 'LO651ELCHQWHANID-2992702;Wireless;Pemasangan mandiri;Mouse Wireless;Baterai;9.7 x 5.5 x 3.8 cm\r\n;Wireless', '1 tahun', 'merah;biru;putih', 'images/mouse10_1.PNG;images/mouse10_2.PNG;images/mouse10_3.PNG', 1, 12, 1),
(57, 'Logitech G300s Gaming Mouse', 'Logitech', 'Masuki dunia gaming dengan menggunakan mouse Logitech Gaming G300. \r\nMouse optikal yang memberikan presisi dan bisa digunakan untuk berbagai aktivitas seperti gaming, edit gambar dan 3D modelling. Mouse ini juga kompatibell dengan berbagai sistem operasi sseperti Windows 7, \r\nVista dan XP, dan sistem operasi lain.', 18, 269000, 0, 3, 'LO651ELBP9WUANID-1949950;Kabel;Pemasangan mandiri;Mouse Kabel;Baterai;4 x 7.2 x 11.3 cm\r\n;Kabel', '3 tahun', 'hitam', 'images/mouse11.PNG', 1, 12, 1),
(58, 'Sades FlashWing Macro Gaming Mouse Dengan 4 Pengaturan DPI', 'Sades', 'Sades Flashwing Merupakan Gaming Mouse berkualitas tinggi dengan harga terjangkau, \r\nDengan Desain Modern Art dan teknologi mutakhir, Gratis Gaming MousePad Sades dan Kabel Protektor \r\n', 18, 234999, 0, 3, 'SA522ELBNEX4ANID-1841621;Kabel;Pemasangan mandiri;Mouse Kabel;Baterai;4 x 7.2 x 11.3 cm\r\n;Kabel', '3 tahun', 'hitam;putih', 'images/mouse12_1.PNG;images/mouse12_2.PNG', 2, 12, 1),
(59, 'Dragonwar - Phantom Gaming Mouse', 'Dragonwar', 'Respon anda untuk bergerak cepat dalam melakukan action dalam game memang sangat penting sehingga membutuhkan sebuah mouse yang memang di desain untuk hal itu. \r\nTersedia fungsi makro yang sangat di butuhkan untuk game-game MOBA seprti DOTA,DOTA 2, HON dan sejenisnya.\r\n', 18, 494000, 0, 3, 'DR192ELBC2CKANID-1223267;Kabel;Pemasangan mandiri;Mouse Phantom;Baterai;11 x 10 x 4 cm\r\n;Kabel', '3 tahun', 'hitam', 'images/mouse13_1.PNG', 1, 12, 1),
(60, 'New 9D 3200DPI Optical 2.4G Wireless Gaming Mouse For DotA FPS Laptop PC Gamer Black', 'Dragonwar', '100% brand new and high quality.Stylish Design.Wear-resistant, anti-interference, anti-pull.\r\nBuilt-in lightweight metal, feel comfortable, mobile and stability.16-bit data path.\r\n', 18, 239000, 0, 3, 'OE427ELBGJ1WANID-1465182;Wireless;Pemasangan mandiri;Mouse Phantom;Baterai;15 x 10 x 10 cm\r\n;Wireless', 'No warranty', 'hitam', 'images/mouse14.PNG', 1, 12, 1),
(61, '1PC mSATA Mini PCI-E SATA SSD To 7+15 Pin 22 pin SATA Adapter Card Green', 'OEM', 'Stylish Design High quality USB connector with magnetic ring, wear-resistant, anti-interference,\r\nanti-pull Built-in lightweight metal, feel comfortable, mobile and stability 16-bit data path Most suitable for Laptop user and PC user Optical technology \r\n', 18, 445000, 0, 3, 'OE427ELBK8Y8ANID-1672070;Wireless;Pemasangan mandiri;Mouse Phantom;Baterai;15 x 10 x 10 cm\r\n;Wireless', 'No warranty', 'hitam', 'images/mouse14.PNG', 1, 12, 1),
(62, 'Xiaomi Round Bluetooth Speaker Original - Hitam', 'xiao mi', 'Speaker dengan suara jernih dan kencang, hadir dengan design baru yang terlihat modern', 18, 258000, 0, 4, 'XI619ELBO3E1ANID-1876903;Ya;Mini USB;SPEAKER;8 x 8 x 5', '1 bulan', 'hitam', 'images/speaker1.PNG', 1, 12, 1),
(63, 'Logitech Z120 Stereo Speaker - Putih', 'logitech', 'Speaker stereo berbentuk kompak yang dibekali tenaga lewat koneksi USB ini hadir dengan pengontrol volume dan tenaga yang terintegrasi, membuatnya begitu simpel untuk terhubung dengan berbagai sumber audio. \r\nHal ini memudahkan Anda untuk menikmati musik, video dan konten multimedia lainnya.\r\n', 18, 134900, 0, 4, 'LO651ELACWBMANID-158224;Ya;Mini USB;SPEAKER;8 x 8 x 5', '1 tahun', 'hitam', 'images/speaker2.PNG', 1, 12, 1),
(64, 'Audiobox A100-U Speaker - Red', 'Audiobox', 'Audiobox A100-U adalah speaker dengan sistem keluaran Bass-Reflex 2.2 yang memungkinkan speaker ini bisa menghasilkan suara bass yang mumpuni \r\nwalaupun dengan ukurannya yang kecil dan menggunakan daya masukan listrik dari USB. Penggunaannya yang sangat mudah, tinggal dihubungkan melalui USB dan jalankan musiknya.', 18, 110000, 0, 4, 'AU230ELAQVYYANID-600164;Ya;USB;SPEAKER;23 x 21 x 19', '1 tahun', 'hitam', 'images/speaker3.PNG', 1, 12, 1),
(65, 'Genius - Speaker SP-HF150 Wood', 'Genius', 'Get rich stereo sound in a compact wood design!  SP-HF150 is a USB powered wooden speaker with four watts of total RMS power, delivering clear vibrant sound and deep bass reverberation.', 18, 120000, 0, 4, 'GE362ELAA2AR7SANID-4251371;Ya;USB;SP-HF150;13 x 8.3 x 8.5', '1 tahun', 'hitam', 'images/speaker4.PNG', 1, 12, 1),
(66, 'Simbadda PMC 280 Portable Speaker - Putih', 'Simbadda', 'Simbadda PMC 280 Portable Speaker merupakan speaker handal persembahan dari Simbadda. Speaker ini akan menemani hari – hari istimewa Anda. Didesain dengan teknologi terkini dan para ahli dibidangnya', 18, 190000, 0, 4, 'SI876ELAWLUCANID-932188;Ya;USB;Portable Speaker;24 x 11 x 15', '1 tahun', 'putih', 'images/speaker5.PNG', 1, 12, 1),
(67, 'Simbadda Speaker CST 1200 N', 'Simbadda', 'Speaker dengan design sederhana namun elegan siap menemani anda menikmati musik kesayangan anda, dilengkapi dengan slot USB & SD Card dapat dengan mudah mendengarkan lagu langsung dari flashdisk. Desain Unik cocok diletakan di ruang santai, bahkan di kantor sekalipun.\r\n', 18, 450000, 0, 4, 'SI876ELAUWT8ANID-840563;Ya;USB;Multimedia Speaker 2.1;29 x 18 x 32', '1 tahun', 'hitam', 'images/speaker6.PNG', 3, 12, 1),
(68, 'Simbadda Portable Speaker PMC 281 - Hitam', 'Simbadda', 'Mendengarkan musik kesayangan anda cukup dengan menghubungkan Flash Disk / SD Card / MMC or Mobile Phone. Dapat menggunakan baterai menjadi mendengarkan musik dapat dilakukan dimana saja dan kapan saja.', 18, 235000, 0, 4, 'SI876ELBBGRSANID-1187437;Ya;USB;Portable Speaker;25 x 16 x 9', '1 bulan', 'hitam', 'images/speaker7.PNG', 3, 12, 1),
(69, 'Simbadda Speaker CST 6200 N', 'Simbadda', 'Simbadda CST 6200N dengan desain elegan dan suara yang nyaman untuk didengar. Suara bass yang dihasilkan cukup menggelegar, seimbang dengan suara treble-nya, sehingga pas untuk didengar telinga Anda.', 18, 525000, 0, 4, 'SI876ELADOQ3ANID-201402;Ya;USB;Multimedia Speaker 2.1;31 x 22 x 27', '1 bulan', 'hitam', 'images/speaker8.PNG', 4, 12, 1);
